PESHAWAR, Jun 17 (APP): Governor Khyber Pakhtunkhwa while exercising has power under Article 109 (a) has summoned the session of provincial assembly on Friday, June 18, 2021 at
3:00 P.M in the Provincial Assembly Building, said an official notification issued here on Thursday.
